import React from 'react';
import {Button, Nav} from 'react-bootstrap';

const HomeNav = () => {
    return (
        <Nav>
            <Nav.Item className={"my-3"}>
                <Nav.Link as={Button}>
                    Back to Timeline
                </Nav.Link>
            </Nav.Item>

        </Nav>
    )
};

export default HomeNav;
